import React from 'react';
import './App.css';
import { connect } from 'react-redux'


class App extends React.Component {



  render() {
    console.log(this.props);

    return (
      <div className="App">
        <h1>Home Page</h1>
      </div>
    );
  }

}

msp = state => {
  return {
    categories: state.categories,
    activities: state.activities
  }
}

mdp = dispatch => {
  return {
    fetchCategories: () => dispatch({type: 'FETCH_CATEGORIES', categories: action.payload}),
    // fetchActivities: () => dispatch({type: 'FETCH_ACTIVITIES', categories: action.payload}),
    }
  }


export default connect(msp, mdp)(App)
